import React from "react";
import { Cabecalho, Titulo } from "./estiloHome";

function Home() {
  return (
    <div>
      <header>
        <Cabecalho>
          <img src="../componets/imegens/jh_1branco" alt="" />
          <Titulo>Target Music</Titulo>
        </Cabecalho>
      </header>
    </div>
  );
}

export default Home;
